import React from 'react'
import axios from 'axios'
import NavbarTitle from "./Nav/Navbar" 
import {Button} from 'react-bootstrap';
import "./Login.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import {faUserCircle,faTrash } from '@fortawesome/free-solid-svg-icons'


const iconID = <FontAwesomeIcon size="1x" color="gray" icon={faUserCircle} />
const iconTrash = <FontAwesomeIcon size="2x" color="black" icon={faTrash} />

const Login = ({setSession})=>{
   
    const [createInputUser,setcreatInputUser] = React.useState("");
    const [createInputPassword,setcreatInputPassword] = React.useState("");
    

    function  logIn(){
        axios
            .post("http://localhost:1000/api/",{
                UserID: createInputUser,
                Password: createInputPassword,
            }).then((res)=>{
                console.log(res.data)
                localStorage.setItem("token",res.data)
                setSession({
                    isLoggedin :true 
                });
            })
    }

    
    return <div>
        <NavbarTitle/>

        <body>
            <section className="Wave">
                <div className="row">

                    <div className="col-md-8">

                    </div>

                    <div className="col-md-4">

                        <br></br><br></br><br></br><br></br>
                        <center>
                        <div className="Modal">
                            <h1>Login</h1>
                            <br></br>
                            <h6  align = 'left'>User ID :</h6>
                            <div class="input-group flex-nowrap">
                                <span class="input-group-text" id="addon-wrapping">{iconID}</span>
                                <input type="User" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter User" value={createInputUser} onChange={(e) => {

                                    setcreatInputUser(e.target.value);
                                }} />
                            </div>
                            <br></br>
                            <h6  align = 'left'>Password :</h6>
                            <div class="input-group flex-nowrap">
                                <span class="input-group-text" id="addon-wrapping">@</span>
                                <input type="Password" className="form-control" id="exampleInputEmail1" aria-describedby="passwordHelp" placeholder="Enter Password" value={createInputPassword} onChange={(e) => {

                                    setcreatInputPassword(e.target.value);
                                }} />
                            </div>
                            <br></br><br></br>

                            <center>


                                <Button variant="outline-info" className="mr-sm-2" style={{ fontFamily: "Nunito" }} onClick={() => {
                                    logIn()
                                }}>Login</Button>
                            </center>
                        </div>
                        </center>            
                    </div>


                </div>


            </section>
        </body>
        
        
        
    </div>;
    
   
}
export default Login;
